import axios from "axios";
import React, { useState, useEffect } from "react";
import MenuBar from '../../components/MenuBar'
import Footer from "../../components/Footer";
import Comment_data from "../../components/mypageComponents/comments_data";
import Comments_privacy from "../../components/mypageComponents/comments_privacy";

const Adminpage = () => {
  const [boolReview, setBoolReview] = useState(false);

  useEffect(() => {
  }, []);

  const ReviewArea = async (e) => {
    setBoolReview(true)
}

    return (
        <div className="App">
          <MenuBar></MenuBar>
          <div className="MainTopDiv">
            <span className="MainTopSpan">관리자 페이지</span>
          </div>

          <div className="mypage_Area">
            <button className="mypage_AreaBtn">회원</button>
            <button className={boolReview ? 'mypage_AreaBtnActive' : 'mypage_AreaBtn'} onClick={e => ReviewArea(e)}>리뷰</button>
            <button className="mypage_AreaBtn">게시글</button>
            <button className="mypage_AreaBtn">댓글</button>
          </div>


          {
            boolReview ?
            <Comment_data></Comment_data>
            : 
            <Comments_privacy></Comments_privacy>
          }



          <Footer></Footer>
        </div>
    );
}

export default Adminpage;
